import React from "react";
import "./home.css";
import ScrollDown from "./ScrollDown";

const Home = () => {
  return (
    <section className="home container" id="home">
      <div className="intro">
        <span className="home-education">Front-end Developer</span>
        <h1 className="home-name">Lucy Lu</h1>

        <ScrollDown />
      </div>
    </section>
  );
};

export default Home;
